import React from 'react';
import './index.css';
import Hamburger from 'hamburger-react';
import Modal from 'react-modal';
import { Link, useLocation } from 'react-router-dom';

const customStyles = {
  content: {
    top: '50%',
    left: '50%',
    right: 'auto',
    bottom: 'auto',
    height: '100%',
    width: '100%',
    transform: 'translate(-50%, -50%)',
  },
};
Modal.setAppElement(document.getElementById('root'));
function Header() {
  const location = useLocation();
  const [isOpen, setOpen] = React.useState(false);
  return (
    <div className='headerBg'>
      <div className='header'>
        <div className='blank'></div>
        <div className='headerTitle'>
          <div className='headerItem'>
            <h2 className='withMargin'>SESSIONS</h2>
            <h2 className='withMarginS'>MANAGE</h2>
            <h2 className='withMargin'>USER ADMIN</h2>
          </div>
          <div className='buger'>
            <Hamburger toggled={isOpen} toggle={setOpen} />
          </div>
          <Modal
            isOpen={isOpen}
            onRequestClose={() => setOpen(false)}
            style={customStyles}
          >
            <div className='modalTitle'>
              <div>
                <h3>Manage</h3>
                <Link to='/'>
                  <h4 className={location.pathname === '/' ? '' : 'normal'}>
                    Sessions
                  </h4>
                </Link>
                <h4 className='normal'>Threshold Sets</h4>
                <Link to='/page3'>
                  <h4
                    className={location.pathname === '/page3' ? '' : 'normal'}
                  >
                    Questionnaire
                  </h4>
                </Link>
                <Link to='/page2'>
                  <h4
                    className={location.pathname === '/page2' ? '' : 'normal'}
                  >
                    AI Model
                  </h4>
                </Link>
              </div>
              <Hamburger toggled={isOpen} toggle={setOpen} />
            </div>
            <div></div>
          </Modal>
          <h3 className='logout'>Logout</h3>
        </div>
      </div>
      <div className='bar'></div>
    </div>
  );
}

export default Header;
